import {Navbar,Nav, NavDropdown} from 'react'
import "./Header.css";
import {useNavigate} from 'react-router-dom';
const Header = () => {
  const Navigate = useNavigate();
  const toogle=()=>{
    return (
      <div className="logouthover" >

      </div>
    )
  }
  return (
    <>
      <div className="Headerpart">
        <nav>
            <h2>USER ID: 06PP125</h2>
            <div className="rightsidemenu">
                <img src="userprofile.svg" alt="estate.png"></img>
                <h3>User Name</h3>
                <img src="down.png" classname="downarrow" onChange={toogle()} alt=""></img>
            </div>
            
        </nav>
        
      </div>
    </>
  );
};
export default Header;




